import React, { useEffect, useState } from 'react';
import Delete from './Delete';
function Get() {
  const [data, setData] = useState([]);

  function GetData() {
    fetch('http://localhost:9000/ApiYoutube')
      .then((res) => res.json())
      .then((data) => {
        setData(data);
      });
  }
  useEffect(() => {
    GetData();
  }, [GetData]);

  return (
    <div className='App'>
      <h1>GET API </h1>
      <table border='1'>
        <tbody>
          <tr>
            <td>ID</td>
            <td>Name</td>
            <td>Email</td>
            <td>Password</td>
            <td>Action</td>
          </tr>
          {data.map((item, i) => (
            <tr key={i}>
              <td>{item.id}</td>
              <td>{item.name}</td>
              <td>{item.email}</td>
              <td>{item.password}</td>
              <td>
                <Delete id={item.id} />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Get;
